import React, { useState } from 'react';
import './index.css';

const Header = () => {
  return (
    <header className="bg-white border-b border-gray-200 py-10 shadow-md">
      <div className="container mx-auto px-4 text-center">
        <h1 className="text-4xl sm:text-5xl font-extrabold tracking-tight leading-tight
          bg-gradient-to-r from-blue-600 via-indigo-600 to-purple-600
          bg-clip-text text-transparent drop-shadow-md">
          H·ªá th·ªëng Ph√°t hi·ªán Deepfake
        </h1>
        <p className="mt-4 text-lg text-gray-600 max-w-2xl mx-auto italic">
          S·ª≠ d·ª•ng tr√≠ tu·ªá nh√¢n t·∫°o ƒë·ªÉ ph√¢n t√≠ch video v√† ph√°t hi·ªán n·ªôi dung gi·∫£ m·∫°o.
        </p>
      </div>
    </header>
  );
};

const Footer = () => {
  return (
    <footer className="bg-gradient-to-r from-gray-900 via-gray-800 to-blue-900 text-white py-6 mt-16 text-center shadow-inner">
      <div className="container mx-auto px-4">
        <p className="text-sm opacity-80">ƒê·ªì √°n nghi√™n c·ª©u ph√°t hi·ªán Deepfake Video</p>
        <p className="text-sm mt-1 opacity-80">¬© Nguy·ªÖn D∆∞∆°ng Minh Quan - 2251012119</p>
      </div>
    </footer>
  );
};

const MethodSelector = ({ method, setMethod }) => {
  const descriptions = {
    'frame-based': 'Ph√¢n t√≠ch t·ª´ng khung h√¨nh trong video ƒë·ªÉ x√°c ƒë·ªãnh ƒë·ªô tin c·∫≠y.',
    'video-based': 'Xem x√©t to√†n b·ªô video nh∆∞ m·ªôt th·ªÉ th·ªëng nh·∫•t ƒë·ªÉ d·ª± ƒëo√°n.'
  };

  return (
    <div className="bg-white p-8 rounded-2xl shadow-xl border border-gray-200
      transition-all duration-300 hover:scale-[1.03] hover:shadow-2xl hover:border-blue-400">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">Ch·ªçn Ph∆∞∆°ng ph√°p Ph√¢n t√≠ch</h2>
      <div className="mb-6">
        <label htmlFor="analysis-method" className="block text-lg font-semibold text-gray-700 mb-2">
          Ph∆∞∆°ng ph√°p
        </label>
        <select
          id="analysis-method"
          className="w-full p-4 border border-gray-300 rounded-lg text-lg bg-gray-50
          focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-all duration-300"
          value={method}
          onChange={(e) => setMethod(e.target.value)}
        >
          <option value="frame-based">Ph√¢n t√≠ch t·ª´ng khung h√¨nh (Frame-based)</option>
          <option value="video-based">Ph√¢n t√≠ch to√†n b·ªô video (Video-based)</option>
        </select>
      </div>
      <div className="bg-gradient-to-r from-blue-50 to-indigo-50 p-6 rounded-xl border-l-4 border-blue-500">
        <p className="text-gray-600 italic">{descriptions[method]}</p>
      </div>
    </div>
  );
};

const UploadForm = ({ file, loading, handleSubmit, handleFileChange }) => {
  return (
    <div className="bg-white p-8 rounded-2xl shadow-xl border border-gray-200
      transition-all duration-300 hover:scale-[1.03] hover:shadow-2xl hover:border-purple-400">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">T·∫£i Video l√™n</h2>
      <form onSubmit={handleSubmit} className="space-y-6">
        <label
          htmlFor="video-file"
          className="flex flex-col items-center justify-center p-8 border-2 border-dashed
          border-gray-300 rounded-xl bg-gray-50 text-gray-500 cursor-pointer
          transition-all duration-300 hover:border-purple-500 hover:bg-purple-50"
        >
          <svg className="w-16 h-16 mb-4 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 16v1a3 3 0 003 3h10a3 3 0 003-3v-1m-4-8l-4-4m0 0L8 8m4-4v12"></path>
          </svg>
          <span className="font-semibold text-gray-700">K√©o v√† th·∫£ video v√†o ƒë√¢y</span>
          <span className="text-sm">ho·∫∑c nh·∫•p ƒë·ªÉ ch·ªçn t·ªáp</span>
          <input type="file" id="video-file" className="hidden" accept="video/*" onChange={handleFileChange} />
        </label>

        {file && (
          <div className="text-gray-600 text-center text-sm mt-2 animate-fadeIn">
            üé¨ ƒê√£ ch·ªçn: <strong>{file.name}</strong> ({(file.size / 1024 / 1024).toFixed(2)} MB)
          </div>
        )}

        <button
          type="submit"
          disabled={loading || !file}
          className={`w-full py-4 px-6 rounded-xl font-bold text-lg uppercase tracking-wide
            transition-all duration-300 shadow-lg
            ${loading || !file
              ? 'bg-gray-400 cursor-not-allowed'
              : 'bg-gradient-to-r from-blue-600 via-indigo-600 to-purple-700 text-white hover:opacity-90 hover:scale-105'
            }`}
        >
          {loading ? 'ƒêang ph√¢n t√≠ch...' : 'Ph√¢n t√≠ch'}
        </button>
      </form>
    </div>
  );
};

const LoadingSpinner = () => (
  <div className="text-center p-8 my-6">
    <div className="w-16 h-16 border-4 border-gray-200 border-t-blue-500 rounded-full animate-spin mx-auto mb-4"></div>
    <p className="text-gray-700 font-semibold">ƒêang x·ª≠ l√Ω video...</p>
  </div>
);

const ResultDisplay = ({ result, processingTime }) => {
  if (!result) return null;
  const isFake = result.is_fake;
  const confidence = (result.confidence * 100).toFixed(2);

  return (
    <div className={`p-6 mt-10 rounded-xl shadow-lg transition-all duration-500
      ${isFake ? 'bg-red-50 border-l-4 border-red-600 text-red-700' : 'bg-green-50 border-l-4 border-green-600 text-green-700'}`}>
      <h2 className="text-2xl font-bold mb-4">K·∫øt qu·∫£ ph√¢n t√≠ch</h2>
      <div className="text-center">
        <h3 className="text-3xl font-extrabold mb-2">
          {isFake ? '‚ö†Ô∏è VIDEO GI·∫¢ M·∫†O' : '‚úÖ VIDEO TH·∫¨T'}
        </h3>
        <p className="text-lg">ƒê·ªô tin c·∫≠y: {confidence}%</p>
        {processingTime && <p className="text-sm mt-2 opacity-70">Th·ªùi gian x·ª≠ l√Ω: {processingTime} gi√¢y</p>}
      </div>
    </div>
  );
};

const App = () => {
  const [method, setMethod] = useState('frame-based');
  const [file, setFile] = useState(null);
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [processingTime, setProcessingTime] = useState(0);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setResult(null);
    setProcessingTime(0);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResult(null);
    const start = Date.now();

    await new Promise((r) => setTimeout(r, 2500)); // gi·∫£ l·∫≠p ph√¢n t√≠ch

    const fake = Math.random() > 0.5;
    const conf = Math.random();
    setResult({ is_fake: fake, confidence: conf });
    setProcessingTime(((Date.now() - start) / 1000).toFixed(2));
    setLoading(false);
  };

  return (
    <div className="min-h-screen flex flex-col bg-gray-100 font-inter">
      <Header />
      <main className="flex-1 py-12 px-4 flex justify-center">
        <div className="container max-w-5xl">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            <MethodSelector method={method} setMethod={setMethod} />
            <UploadForm file={file} loading={loading} handleFileChange={handleFileChange} handleSubmit={handleSubmit} />
          </div>
          {loading && <LoadingSpinner />}
          {result && <ResultDisplay result={result} processingTime={processingTime} />}
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default App;
